import logo from "./logo.svg";
import "./App.css";
import Datas from "./data.json";
import Infos from "./example_data.json";

function App() {
  const info = Infos.map((Info) => (
    <ul key={Info.id}>
      <li>
        <h1>Name {Info.name}</h1>
      </li>
      <li>
        <h3>Categories : {Info.categories}</h3>
      </li>
      <li>
        <h3>Image</h3>
        <img src={Info.profile_image_url} alt={"logo"} width="100" />
      </li>
      {Info.images.forEach((item, key) => {
        console.log(`show ${item}`);
        <li>
          <img
            src={
              "https://images.unsplash.com/photo-1485182708500-e8f1f318ba72?crop=entropy&cs=tinysrgb&fit=max&fm=jpg&ixid=MnwzMDcxMTl8MHwxfHNlYXJjaHwzfHxyZXN0YXVyYW50JTIwY29mZmVlfGVufDB8fHx8MTY0NjM2Nzg3NQ&ixlib=rb-1.2.1&q=80&w=1080"
            }
            alt={"logo1"}
            width="100"
          />
        </li>;
      })}

      <li>
        <h4>Images</h4>
        <img alt={"logo1"} width="100" />
      </li>
      <li>
        <h1>{Info.operation_time}</h1>
      </li>
    </ul>
  ));
  const test = Datas.map((data) => (
    <ul key={data.id}>
      <li> name{data.color}</li>
      <li>{data.value}</li>
      <br />
    </ul>
  ));

  return (
    <div className="App">
      <h1>APP</h1>
      {info}
    </div>
  );
}

export default App;
